import streamlit as st
import streamlit.components.v1 as components

def main():

    imageCarouselComponent = components.declare_component("image-carousel-component", path="frontend/public")

    imageUrls = [
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQQnhpkIpeX7S2UdfCrCoU8LkYYk2aYVVS0aw&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSPVRrDkoqXOUyACerJj6952DTJNrPW_MFfZF71ilht2Fp8iRvZl2GT-3BcmdFsQ21gz1Y&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR5COvmHAoyl4eWEZ0bMclGd_Jm5w6JWzQXuw&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ1-1U-7Y2To9AW9WMbBTNIgXlB7lG67oznfw&usqp=CAU",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQT9CupP0o365saJ1WbvrUXSTibuq431A5tww&usqp=CAU"


        ]
    selectedImageUrl = imageCarouselComponent(imageUrls=imageUrls, height=200)

    if selectedImageUrl is not None:
        st.image(selectedImageUrl)

if __name__ == "__main__":
    main()
